import { Component, Inject, Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Calculo } from '../Models/Calculo';
import { Observable } from 'rxjs';

@Injectable({ providedIn: 'root' })
export class CalculoService {

  constructor(private httpClient: HttpClient) { }

  salvar(formValue: any): Observable<Calculo[]> {
    console.warn(formValue);
    var baseUrlExterna = "https://localhost:44365/";
    return this.httpClient.post<Calculo[]>(baseUrlExterna + 'api/Calculo', formValue);
    //return this.httpClient.post<Calculo[]>(baseUrlExterna + 'api/Calculo', formValue).subscribe(result => {
    //}, error => console.error(error));
  }

}
